-- Buat Schema Baru
CREATE SCHEMA IF NOT EXISTS sampah AUTHORIZATION postgres;

-- Buat Tabel dan relasnya
CREATE TYPE sampah.status_tps AS ENUM ('AKTIF', 'PENUH', 'TIDAK_AKTIF');

CREATE TYPE sampah.status_lahan AS ENUM ('KOSONG', 'TERPAKAI', 'TIDAK_LAYAK');

CREATE TYPE sampah.tipe_jalan AS ENUM ('primary', 'secondary', 'tertiary', 'trunk', 'unclassified', 'residential');

CREATE TABLE
  sampah.kecamatan (
    id SERIAL PRIMARY KEY,
    nama varchar(50) NOT NULL,
    geom geometry NOT NULL
  );

CREATE TABLE
  sampah.kelurahan (
    id SERIAL PRIMARY KEY,
    kecamatan_id int,
    nama varchar(50),
    luas decimal NOT NULL,
    jumlah_penduduk int NOT NULL,
    timbulan_sampah decimal NOT NULL,
    geom geometry NOT NULL
  );

CREATE TABLE
  sampah.tps (
    id SERIAL PRIMARY KEY,
    kelurahan_id integer,
    nama varchar(50) NOT NULL,
    kapasitas decimal NOT NULL,
    volume_terpakai decimal NOT NULL,
    status sampah.status_tps DEFAULT 'AKTIF',
    geom geometry NOT NULL
  );

CREATE TABLE
  sampah.jalan (
    id SERIAL PRIMARY KEY,
    nama varchar NULL,
    tipe sampah.tipe_jalan DEFAULT 'unclassified',
    panjang decimal NOT NULL,
    geom geometry NOT NULL
  );

CREATE TABLE
  sampah.lahan_potensial (
    id SERIAL PRIMARY KEY,
    kelurahan_id int,
    luas decimal NOT NULL,
    status sampah.status_lahan DEFAULT 'KOSONG',
    jarak_ke_jalan decimal NOT NULL,
    jarak_ke_pemukiman decimal NOT NULL,
    geom geometry NOT NULL
  );

CREATE TABLE
  sampah.rute_angkut (
    id SERIAL PRIMARY KEY,
    tps_id int,
    jarak decimal NOT NULL,
    waktu_tempuh time NOT NULL,
    geom geometry NOT NULL
  );

CREATE TABLE
  sampah.detail_rute (
    id SERIAL PRIMARY KEY,
    rute_angkut_id int,
    jalan_id int
  );

ALTER TABLE sampah.kelurahan ADD FOREIGN KEY (kecamatan_id) REFERENCES sampah.kecamatan (id);

ALTER TABLE sampah.tps ADD FOREIGN KEY (kelurahan_id) REFERENCES sampah.kelurahan (id);

ALTER TABLE sampah.lahan_potensial ADD FOREIGN KEY (kelurahan_id) REFERENCES sampah.kelurahan (id);

ALTER TABLE sampah.rute_angkut ADD FOREIGN KEY (tps_id) REFERENCES sampah.tps (id);

ALTER TABLE sampah.detail_rute ADD FOREIGN KEY (jalan_id) REFERENCES sampah.jalan (id);

